import React from 'react';
import LaunderingImage from "../../assets/Laundering.jfif";
import IroningImage from '../../assets/Ironing.jfif';
import NavBar from '../../components/NavBar';

const Home = () => {
    return (
        <div>
            <NavBar />
            <div className="container mx-auto px-4">
                <h1 className="text-4xl font-bold mt-8 mb-6 text-center">Welcome to Homely Heros</h1>
                <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
                    <div className="max-w-md mx-auto bg-white rounded-lg overflow-hidden shadow-lg">
                        <img src={LaunderingImage} alt="Laundering" className="w-full h-auto" />
                        <div className="px-6 py-4">
                            <div className="font-bold text-xl mb-2">Laundering Services</div>
                            <p className="text-gray-700 text-base">
                                We offer professional laundering services to make your clothes fresh and clean.
                            </p>
                        </div>
                    </div>
                    <div className="max-w-md mx-auto bg-white rounded-lg overflow-hidden shadow-lg">
                        <img src={IroningImage} alt="Ironing" className="w-full h-auto" />
                        <div className="px-6 py-4">
                            <div className="font-bold text-xl mb-2">Ironing Services</div>
                            <p className="text-gray-700 text-base">
                                Our expert team ensures your clothes are perfectly ironed and wrinkle-free.
                            </p>
                        </div>
                    </div>
                </div>
            </div>
            <div className="text-center mt-8">Footer</div>
        </div>
    );
};

export default Home;
